import React, { Component } from "react";
import { useStore } from "zustand";
import { Badge, Table } from "reactstrap";

const HomeList = () => {
  const [{ homes, currentCategory }, dispatch] = useStore((state) => ({
    homes: state.homes,
    currentCategory: state.currentCategory,
  }));

  React.useEffect(() => {
    dispatch({ type: "FETCH_HOMES" });
  }, []);

  return (
    <div>
      <h3>
        <Badge style={{ marginRight: "10px" }} color="warning">
          Homes
        </Badge>
        <Badge color="success">{currentCategory.categoryName}</Badge>
      </h3>

      <Table>
        <thead>
          <tr>
            <th>#</th>
            <th>Name</th>
          </tr>
        </thead>
        <tbody>
          {homes.map((home) => (
            <tr key={home.id}>
              <th scope="row">{home.id}</th>
              <th>{home.productName}</th>
            </tr>
          ))}
        </tbody>
      </Table>
    </div>
  );
};

export default HomeList;
